import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import {BucketService} from "../objects/services";
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent implements OnInit{
  title = 'angular';

  buckets: string[]=[];

  constructor(private bucketService: BucketService) {}

  ngOnInit() {
    this.bucketService.listBuckets().subscribe(
      (response: any) => {
        console.log(response);
        this.buckets = response.buckets;
      },
      (error) => {
        console.error(error);
      }
    );
  }
  createBucket() {
    this.bucketService.createBucket(this.bucketName).subscribe((response: any) => {
      console.log(response);
    });
  }

  deleteBucket() {
    this.bucketService.deleteBucket(this.bucketName).subscribe((response: any) => {
      console.log(response);
    });
  }
}

<ul>
  <li *ngFor="let bucket of buckets">{{ bucket }}</li>
</ul>
